async function getData(url = '') {
    url = API_URL + url;

    const response = await fetch(url, {
        method: 'GET'
    });
    return await response.json();
}

function dashboard(){
    buildLeaderboard();
    buildparticipantsList();
}

function buildLeaderboard(){
    var clans = data.clans;
    var ordered = getClansOrderedByFame(clans);
    var trN = document.createElement("tr");
    var trP = document.createElement("tr");
    ordered.forEach(clan => {
        var tdN = document.createElement("td");
        var tdP = document.createElement("td");
        tdN.innerHTML = clan.name;
        tdP.innerHTML = clan.periodPoints;
        if(clan.name == clanName){
            tdN.style.color = "#5F25B3";
            tdP.style.color = "#5F25B3";
        }
        trN.appendChild(tdN);
        trP.appendChild(tdP);
    });
    leaderboard.appendChild(trN);
    leaderboard.appendChild(trP);
}

function buildparticipantsList(){
    var participants = data.clan.participants;
    var ordered = getParticipantsOrderedByFame(participants);
    ordered.forEach(participant => {
        var tr = document.createElement("tr");
        var name = document.createElement("td");
        var points = document.createElement("td");
        name.innerHTML = participant.name;
        points.innerHTML = participant.fame;
        if(participant.fame >= minimumPoints){
            points.style.color = "green";
        }else{
            points.style.color = "red";
        }
        tr.appendChild(name);
        tr.appendChild(points);
        participantsList.appendChild(tr);
    });
}

function getClansOrderedByFame(clans){
    return clans.sort(sortClanByPeriodPoints);
}

function getParticipantsOrderedByFame(participants){
    return participants.sort(sortParticipantsByFame);
}

function sortClanByPeriodPoints(clan1, clan2){
    if ( clan1.periodPoints < clan2.periodPoints ){
        return 1;
    }
    if ( clan1.periodPoints > clan2.periodPoints ){
        return -1;
    }
    return 0;
}

function sortParticipantsByFame(p1, p2){
    if ( p1.fame < p2.fame ){
        return 1;
    }
    if ( p1.fame > p2.fame ){
        return -1;
    }
    return 0;
}



